import { Box, Button, Grid, Menu } from "@mui/material";

import Menubar from "./Menu";
import { Outlet } from "react-router-dom";
import Home from "./Home";
import { Route, Routes } from "react-router-dom";
import CalenderHistory from './Water-Tracker/Calender';
import BalanceTransactions from './Water-Tracker/Transactions';

export default function Watertracker() {

  return (
    <Grid style={{ background: "#e6e8f7" }}>
      <p style={{ textAlign: "left" }}>
        <Menubar />
      </p>
      <Routes>
        <Route path="home" element={<Home />}>

          {/* <Route path="calender" element={<CalenderHistory/>}></Route>
          <Route path="balance" element={<BalanceTransactions/>}></Route> */}
        </Route>
      </Routes>
      {<Outlet />}
    </Grid>
  );
}
